  input: TEXT,SA11A1,SA11A1.64599,"On 9/20/06 we received a contribution from Bruce
    Bodner in the amount of $25,000 which was deposited into our federal account.  Fifteen
    thousand dollars was transferred to our non-federal account, which can accept
    unlimited contributions from individuals, on 9/20/06.  A letter was sent to Bruce
    Bodner advising him of how his contribution was split into our accounts and to
    offer him a chance for a refund.   According to AO 2001-17, the Commission has
    deemed it sufficient to deposit checks that exceed the donor's federal limits
    into our federal account and then to make a transfer to the non-federal account
